import React from 'react'


function SobreMi() {
  return (
    <div className='sobreMi-container' id= "sobremi">
      <h1>Sobre mi</h1>
        <div className='sobreMi'>
          <p>Hola! Me llamo Cecilia Peruzzi, soy Desarrolladora Web FullStack Junior en crecimiento. Me gradué de Digital House, lo cual fue muy importante para mi formación, ya que adquirí experiencia práctica en la creación de aplicaciones web funcionales y atractivas, así como en el desarrollo de interfaces de usuario intuitivas. Además aprendí la importancia del trabajo en equipo y del compañerismo. A pesar de mi condición de Junior, me esfuerzo por escribir código limpio y modular que sea fácil de mantener y escalar a medida que evolucionan los requisitos del proyecto. Siempre estoy abierta a aprender nuevas tecnologías y metodologías para mejorar constantemente mis habilidades.</p>
        
        <a href="mailto:ceciliaperuzzi10@gmail.com" className='button-contacto'> Contacto: ceciliaperuzzi2@gmail.com </a>
        </div>
    </div>
  )
}

export default SobreMi
